import React, { useEffect, useState } from 'react'
//import LineChart from './LineChart';


const GetRadon = () => {

    const [sensor, setData] = useState([]);

    useEffect(() => {
        async function obtenerDatos() {
            const response = await fetch('/api/radon');
            const data = await response.json();
            setData(data.Radon);
        }

        obtenerDatos();
    }, []);

    console.log(sensor)
    console.log(Array.isArray(sensor))

    /*
    const [sensorplot, setSensorData] = useState({
        labels: sensor.map((data) => data.ts),
        datasets: [{
            label: "data sensor",
            data: sensor.Fecha.map((data) => data.value),
        }]
    })
    */

    return(
        <div>
            {sensor.map(datos => (
                <li key={datos.ts}> {datos.value} </li>
            ))}
        </div>
    );
    
}

export default GetRadon;
